.grid {
  display: grid;
  grid-template-columns: repeat(1, 1fr);

  @include onDesktop {
    grid-template-columns: repeat(9, 1fr);
    max-width: 937px;
  }

  &__item {

    @for $start from 1 through 9 {
      @for $end from $start through 9 {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }

        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }
  }
}

